@import "reset.scss";
@import "variable";
@import "infoSection";
@import "home";
@import "resume";

* {
  box-sizing: border-box;
}

html,
body {
  background: $color1;
  font-size: 18px;
  font-family: "Roboto Mono", monospace;
  height: 100%;
}

.menu-icon {
  position: fixed;
  right: 36px;
  top: 36px;
  padding: 20px;
  z-index: 11;
  cursor: pointer;
  .fa-solid {
    font-size: 2rem;
    color: $color1;
  }
}

.primary-btn {
  background: $color1;
  -webkit-border-radius: 30px;
  -moz-border-radius: 30px;
  border-radius: 30px;
  text-align: center;
  color: $color3;
  padding: 15px 30px;
  display: inline-block;
  text-transform: uppercase;
  letter-spacing: 3px;
  margin-right: 15px;
  text-decoration: none;
  transition: all .3s ease-in-out;
  &:hover {
    background: black;
    color: $color3;

  }
}

.ghost-btn {
    text-decoration: none;
  border: 4px solid $color1;
  -webkit-border-radius: 30px;
  -moz-border-radius: 30px;
  border-radius: 30px;
  text-align: center;
  color: $color1;
  padding: 12px 27px;
  display: inline-block;
  text-transform: uppercase;
  letter-spacing: 3px;
  transition: all .3s ease-in-out;
  &:hover {
    border-color: $hoverColor;
  }
}


  #menu {
    background: $color1;
    position: fixed;
    width: 100%;
    top: 0;
    bottom: 0;
    transform: translate3d(-100%, 0,0);
    z-index: 10;
    display: flex;
    align-items: center;
    justify-content: center;
    opacity: 1;
    transition: all 0.5s ease-in-out;

    nav {
      width: 400px;
      text-align: center;
      a {
        display: block;
        font-size: 2.3rem;
        padding: 1rem;
        text-decoration: none;
        color: white;
        &:hover {
          color: $color5;
        }
      }
    }
  }


.menu-active {
  #menu {
    width: 100%;
    height: 100%;
    top: 0;
    bottom: 0;
    transform: translate3d(200px, 0,0);
  }

  .menu-icon {
    .fa {
        color: white
    }
  }
}
